-- Adds street address and road centreline data to the Waiheke data set.
-- Also creates Street Address and RCL spatial layers and Spatial Searches
-- as well as some related tidy up actions. 
-- This script takes approx 45 seconds to run. 

-- Remove the id value from the parcel last_namepart field to tidy up
-- the map labels
UPDATE  cadastre.cadastre_object
SET     name_lastpart = trim(regexp_replace(name_lastpart, id, ''))
WHERE   trim(regexp_replace(name_lastpart, id, '')) != ''
AND    name_firstpart NOT LIKE 'Part%'
AND    name_firstpart NOT LIKE 'Allotment%PSH%';

-- Add House Number level
INSERT INTO cadastre.level (id, name, structure_code, type_code, change_user)
SELECT 'house-num', 'House Number', 'point', 'geographicLocator', 'soladev'
WHERE NOT EXISTS (SELECT id FROM cadastre.level WHERE id = 'house-num');

-- Add House Number Spatial Layer and Layer Query
DELETE FROM system.config_map_layer
 WHERE "name" = 'house_num';

DELETE FROM system.query
 WHERE "name" IN ('SpatialResult.getHouseNum');

 -- Add the necessary dynamic queries
INSERT INTO system.query("name", sql)
 VALUES ('SpatialResult.getHouseNum', 
 'select su.id, su.label,  st_asewkb(su.reference_point) as the_geom from cadastre.spatial_unit su, cadastre.level l where su.level_id = l.id and l."name" = ''House Number'' and ST_Intersects(su.reference_point, ST_SetSRID(ST_3DMakeBox(ST_Point(#{minx}, #{miny}),ST_Point(#{maxx}, #{maxy})), #{srid}))');

 -- Configure the new Navigation Layer
INSERT INTO system.config_map_layer ("name", title, type_code, pojo_query_name, pojo_structure, pojo_query_name_for_select, style, active, item_order, visible_in_start)
 VALUES ('house_num', 'House number', 'pojo', 'SpatialResult.getHouseNum', 'theGeom:Point,label:""',  null, 'house_num.xml', TRUE, 43, FALSE);
 
 
 -- Update the Road Centreline map layer configuration to support Multi-LineStrings
UPDATE  system.config_map_layer 
SET pojo_structure = 'theGeom:MultiLineString,label:""',
    item_order = 45
WHERE name = 'road-centerlines';

-- Reset which layers are visible on startup of the map
UPDATE system.config_map_layer 
SET visible_in_start = FALSE
WHERE name IN ('survey-controls', 'roads', 'applications', 'parcel-nodes', 'parcels-historic-current-ba',
'pending-parcels'); 

-- Locality Map Search
DELETE FROM system.map_search_option
 WHERE query_name = 'map_search.locality';
 
 DELETE FROM system.query
 WHERE "name" = 'map_search.locality';
 
 INSERT INTO system.query("name", sql)
 VALUES ('map_search.locality', 
 'SELECT co.id, a.description as label, st_asewkb(co.geom_polygon) as the_geom 
  FROM cadastre.cadastre_object co, cadastre.spatial_unit_address sa,
       address.address a
  WHERE co.id = sa.spatial_unit_id
  AND   a.id = sa.address_id  
  AND compare_strings(#{search_string}, a.description)
  AND co.geom_polygon IS NOT NULL
  ORDER BY a.description');
 
 INSERT INTO system.map_search_option(code, title, query_name, active, min_search_str_len, zoom_in_buffer)
 VALUES ('LOCALITY', 'Locality', 'map_search.locality', TRUE, 3, 100); 

 
 -- Fix for Parcels layer
 UPDATE system.query SET sql = 
 'select co.id, co.name_firstpart || ''/'' || co.name_lastpart as label,  st_asewkb(st_transform(co.geom_polygon, #{srid})) as the_geom from cadastre.cadastre_object co where type_code= ''parcel'' and status_code= ''current'' and ST_Intersects(st_transform(co.geom_polygon, #{srid}), ST_SetSRID(ST_3DMakeBox(ST_Point(#{minx}, #{miny}),ST_Point(#{maxx}, #{maxy})), #{srid}))'
 WHERE "name" = 'SpatialResult.getParcels';

